          <li className="active">Home</li>
          <li>Search</li>
          <li>Shop</li>
          <li>About</li>
        </ul>
        <button
          onClick={() => {
            if (props.wishlistv === false) props.wishlistvisble(true);
            else props.wishlistvisble(false);
          }}
        >
          wishlist
        </button>
        <button>Cart</button>
      </header>
    </>
  );
}
export default Navbar;
